import User from "./User";
import "./App.css";
function App() {

  return (
    <div className="row">
      <User name ='ali' age={13} height={140} />
      <User name ="gholi" age={15} height={156} />
      <User name =' sara' age={18} height={170} />
    </div>
  );
}
User.defaultProps ={
    name:"shaghooli"
}

export default App;
